query MyQuery($order_by: system_Classes_order_by = { id: asc }, $size: Int = 10, $page: Int = 1) {
  system_list_Classes(order_by: $order_by, size: $size, page: $page) {
    classCode
    className
    id
  }
}

query MyQuery($id: Int) {
  system_find_one_Classes(where: { id: { _eq: $id } }) {
    classCode
    className
    id
  }
}

mutation MyMutation($classCode: String, $className: String, $id: ID = "") {
  system_create_Classes(
    data: { classCode: $classCode, className: $className, id: $id }
  ) {
    classCode
    className
    id
  }
}

mutation MyMutation($classCode: String, $className: String, $id: ID) {
  system_update_Classes_by_id(
    id: "1"
    _set: { classCode: $classCode, className: $className, id: $id }
  ) {
    classCode
    className
    id
  }
}

mutation MyMutation($id: ID!) {
  system_delete_Classes_by_id(id: $id) {
    classCode
    className
    id
  }
}
